try{(()=>{const t=document.getElementById("Noty");if(null==t)return;const e=t.getAttribute("data"),o=t.value;"success"===e?new Noty({theme:"relax",text:o,type:e,layout:"topRight",progressBar:!0,closeWith:["click","button"],timeout:6e3}).show():new Noty({theme:"sunset",text:o,type:e,layout:"topRight",progressBar:!0,closeWith:["click","button"],timeout:6e3}).show()})()}catch(t){console.log(t)}